import React from "react";
import { useForm } from "react-hook-form";
import API from "../utils/booksapi";

export default class Main extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    const onSubmit = (data) => {
      console.log(data);
      searchBook(data);
    };
    var books = [];
    const searchBook = (data) => {
      console.log(data);
      API.getBooks(data.search)
        .then((res) => {
          var results = res.data.items;
          results.forEach((result) => {
            books.push(result.volumeInfo);
          });
          console.log(books);
        })
        .catch((error) => {
          console.log(error);
        });
    };
  }

  render() {
    return (
      <div>
        <h1>elo{this.state.data[0].username}</h1>
      </div>
    );
  }
}
